class Solution:
    def majorityElement(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        basenum = 0
        numcount = 0
        for num in nums:
            if num is not basenum:
                if numcount > 0:
                    numcount = numcount - 1
                else:
                    basenum = num
                    numcount = numcount + 1
            else:
                basenum = num
                numcount = numcount + 1
        return basenum


